import React from "react";
import "../styles/Home.css";
import Button from "../Components/Button";
const HomeCard = () => {
  return (
    <div className="HomeCard">
      <div className="Cardb">
        <Button button="Items Found" />

        <Button button="Items Lost" />
      </div>
    </div>
  );
};

export default HomeCard;
